import React, { FC } from 'react';
import Header from './Header';

const layoutStyle = {
  margin: -10,
  padding: -0,
  border: '1px solid #DDD',
};


interface Props {
  children: React.ReactNode;
}

const Layout: FC<Props> = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
  </div>
);

export default Layout;
